INSERT INTO `aggregator_item` (`iid`, `fid`, `title`, `link`, `author`, `description`, `timestamp`, `guid`) VALUES
(1, 1, 'WFA Annual Father''s Day Cup -- Montessori School of Waukesha: Waukesha, WI', 'http://askfred.net/Events/moreInfo.php?tournament_id=15452', 'k.zolna@yahoo.com', 'Jun 16, 2012  More info. to follow.', 1310871546, ''),
(2, 1, 'WFA Ironman- Mixed Epee Open -- Montessori School of Waukesha: Waukesha, WI', 'http://askfred.net/Events/moreInfo.php?tournament_id=15453', 'k.zolna@yahoo.com', 'May 20, 2012  More info. to come!', 1310872171, ''),
(3, 1, 'WFA Women''s Open and Mixed Y14 -- Montessori School of Waukesha: Waukesha, WI', 'http://askfred.net/Events/moreInfo.php?tournament_id=15456', 'k.zolna@yahoo.com', 'May 6, 2012  More info. to come!', 1310873111, ''),
(4, 1, 'WFA Mixed C and Under -- Montessori School of Waukesha: Waukesha, WI', 'http://askfred.net/Events/moreInfo.php?tournament_id=15454', 'k.zolna@yahoo.com', 'Apr 15, 2012  More info. to come!', 1310872579, ''),
(5, 1, 'Sabre Rattlers Open -- Gymnasium, Wells Cultural Center, UW-Rock County: Janesville, WI', 'http://askfred.net/Events/moreInfo.php?tournament_id=15582', 'brian.duckwitz@uwc.edu', 'Apr 7, 2012  Sanctioned Tournament. Full USFA kit required. Mask tests performed. Medals for 1st-3rd.\n\nPreregistered fencer cost: $20 for one event, $30 for two, $40 for three.  $25/$35/$45 w/o preregistration.', 1312233032, ''),
(6, 1, 'WFA Mixed D and Under -- Montessori School of Waukesha: Waukesha, WI', 'http://askfred.net/Events/moreInfo.php?tournament_id=15455', 'k.zolna@yahoo.com', 'Mar 11, 2012', 1310872752, ''),
(7, 1, 'WFA E and Under -- Montessori School of Waukesha: Waukesah, WI', 'http://askfred.net/Events/moreInfo.php?tournament_id=15457', 'k.zolna@yahoo.com', 'Feb 12, 2012  More info. to come!', 1310874235, ''),
(8, 1, 'WFA Swords and Snowflakes Open -- Montessori School of Waukesha: Waukesha, WI', 'http://askfred.net/Events/moreInfo.php?tournament_id=15458', 'k.zolna@yahoo.com', 'Jan 8, 2012  More info. to come!', 1310874545, ''),
(9, 1, 'WFA Mixed C and Under -- Montessori School of Waukesha: Waukesha, WI', 'http://askfred.net/Events/moreInfo.php?tournament_id=15459', 'k.zolna@yahoo.com', 'Dec 11, 2011  More info. to come!', 1310874790, ''),
(10, 1, 'Turkey Meet Open -- Catholic Memorial High School: Waukesha, WI', 'http://askfred.net/Events/moreInfo.php?tournament_id=15589', 'dtorchia@wi.rr.com', 'Nov 20, 2011  This year Turkeys will be donated to a food pantry.\n\nEntry fee is $25 for those who pre-register.  $30 at the door.\n$10 extra for each multiple events.\nUSFA rated referee''s will be hired.', 1312305526, ''),
(11, 1, 'Mizzou Fall Open/STL Division Tournament -- University of Missouri Rec Center: Columbia, MO', 'http://askfred.net/Events/moreInfo.php?tournament_id=15546', 'mfwn78@mail.missouri.edu', 'Nov 19, 2011 - Nov 20, 2011  Come one, come all to Mizzou''s annual fall tournament! This year with Grounded Strips!!!!!!', 1311787625, ''),
(12, 1, 'WFA Mixed D and Under -- Montessori School of Waukesha: Waukesha, WI', 'http://askfred.net/Events/moreInfo.php?tournament_id=15460', 'k.zolna@yahoo.com', 'Nov 13, 2011  More info. to come!', 1310875055, ''),
(13, 1, 'Illinois Junior Olympic Qualifier -- Patten Gym, Northwestern University: Evanston, IL', 'http://askfred.net/Events/moreInfo.php?tournament_id=15263', 'northwesternfencing@yahoo.com', 'Nov 6, 2011  $20 per event. $10 late fee if not preregistered. Checks made out to Northwestern.', 1306894933, ''),
(14, 1, 'The Fencers Academy Super Youth Circuit -- Missouri Athletic Club - West: St. Louis, MO', 'http://askfred.net/Events/moreInfo.php?tournament_id=15512', 'info@thefencersacademy.com', 'Nov 5, 2011 - Nov 6, 2011  This is a National Qualifier for Youth 10, 12, and 14 events. Fencers must be USFA members and show proof of membership. Those who have not had their birth year verified by the USFA will also have to show a birth certificate or passport at the tournament', 1311494503, ''),
(15, 1, 'Remenyik Open -- Henry Crown Sports Center, Northwestern Univ: Evanston, IL', 'http://askfred.net/Events/moreInfo.php?tournament_id=15262', 'northwesternfencing@yahoo.com', 'Oct 29, 2011 - Oct 30, 2011  $45 for each event (includes $5 ROC fee). $25 late fee if not pre-registered AND prepaid.  Map may be wrong. Take Sheridan to Lincoln and turn towards lake', 1306894486, ''),
(16, 1, 'WFA Mixed E and Under -- Montessori School of Waukesha: Waukesha, WI', 'http://askfred.net/Events/moreInfo.php?tournament_id=15461', 'k.zolna@yahoo.com', 'Oct 16, 2011  More info. to come!', 1310875312, ''),
(17, 1, 'King of the Mountain Epee Challenge -- Elephant Rocks State Park, Missouri: Graniteville, MO', 'http://askfred.net/Events/moreInfo.php?tournament_id=15268', 'milstdfarm@aol.com', 'Oct 9, 2011  Epee-in-the-round atop the ''Elephants'' using the Hitmate wireless scoring system. Plus pot-luck picnic.', 1306964914, ''),
(18, 1, 'Sabre Rattlers Fall Open -- Gymnasium, Wells Cultural Center, UW-Rock County: Janesville, WI', 'http://askfred.net/Events/moreInfo.php?tournament_id=15528', 'brian.duckwitz@uwc.edu', 'Oct 8, 2011  Sanctioned Tournament. Full USFA kit required. Mask tests performed. Medals for 1st-3rd.\n\nPreregistered fencer cost: $20 for one event, $30 for two, $40 for three.  $25/$35/$45 w/o preregistration.', 1311645862, ''),
(19, 1, 'TFA DIVII ( C& under) ROC and Open Tournament -- TFA GYM: St. Louis, MO', 'http://askfred.net/Events/moreInfo.php?tournament_id=15588', 'info@thefencersacademy.com', 'Oct 1, 2011 - Oct 2, 2011  Please note:  the only events that will receive recognition as ROC events in this Tournament are the Div II (C& under) events. Registration $45\nEach event $35', 1312277919, ''),
(20, 1, 'Burton Open -- Henry Crown Sports Center, Northwestern University: Evanston, IL', 'http://askfred.net/Events/moreInfo.php?tournament_id=15261', 'northwesternfencing@yahoo.com', 'Oct 1, 2011  $25 per weapon. $15 late fee if not preregistered AND prepaid.  Venue is on north campus. Map may be wrong. Take Sheridan to Lincoln and turn towards lake and park in the big parking lot.', 1306894156, ''),
(21, 1, '3rd Annual Venturing-BSA National Championships -- Beaumont Scout Reservation: High Ridge, MO', 'http://askfred.net/Events/moreInfo.php?tournament_id=15275', 'milstdfarm@aol.com', 'Sep 24, 2011  A part of the 2011 Fall Fun Rally sponsored by St. Louis Area Council Venturers.\n\nOnly Venturers, Explorers or Boy Scouts who are otherwise eligible for Venturing may enter.\n\nElectric scoring. Not USFA.', 1307006604, ''),
(22, 1, 'WFA "Mask of Zorro" Mixed Open -- Montessori School of Waukesha: Waukesha, WI', 'http://askfred.net/Events/moreInfo.php?tournament_id=15462', 'k.zolna@yahoo.com', 'Sep 11, 2011  USFA Sanc''d. Mask checks. Full gear required. Event fee $25. Add''l. event $10. Late fee $10. Winner receives "Zorro Rapier Sword!" Medals to top four! USFA rules enforced! 2 weapons & cords, etc.!', 1310875882, ''),
(23, 1, 'F.C.C. Tournament -- Fencing Center of Chicago: Park Ridge, IL', 'http://askfred.net/Events/moreInfo.php?tournament_id=15415', 'abdikulov@yahoo.com', 'Aug 27, 2011 - Aug 28, 2011  This will be an Unclassified, Youth, and Open foil tournament.', 1310192734, ''),
(25, 1, 'WFA "Dog Days of Summer Duel" Open -- Montessori School of Waukesha: Waukesha, WI', 'http://askfred.net/Events/moreInfo.php?tournament_id=15464', 'k.zolna@yahoo.com', 'Aug 7, 2011  USFA Sanc''d. Mask checks. Full gear required. Event fee $25. Add''l. event $10. Late fee $10. Cash prize for winner! A1 event-$100, B1-$50, C1-$25. A2 event-$200, B2-$100, C2-$50. Medals to top four! USFA rules enforced! 2 weapons & cords, etc.!', 1310881509, '');
